import React from "react";
import "./RoomDetail.css";
import p9 from "../imge/img-9.jpeg";

function RoomDetail() {
  return (
    <div className="rooms__detail__container">
      <div className="rooms__detail__wrapper">
        <div className="rooms__derail__introduce">
          <div className="rooms__detail__carousel">
            <img className="carousel__img" alt="carousel img" src={p9} />
            <img className="carousel__img" alt="carousel img" src={p9} />
            <img className="carousel__img" alt="carousel img" src={p9} />
            <img className="carousel__img" alt="carousel img" src={p9} />
          </div>
          <div className="rooms__detail__owner">
            <div className="rooms__detail__owner__label">
              Taiwan-Taipei-Victor Home
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default RoomDetail;
